textOriginal:
1 timóteo 2; 1-2

1 Antes de tudo, recomendo que se façam súplicas, orações, intercessões e ações de graças por todos os homens;

2 pelos reis e por todos os que exercem autoridade, para que tenhamos uma vida tranquila e pacífica, com toda a piedade e dignidade.

O povo ainda acredita que esses líderes religiosos estão preocupados com a nação, o que parece é que querem mesmo é poder pessoal e ganhar grana!
  Falavam tão mal do Lula, xingavam ele de ladrão, cachaceiro, que o governo dele foi o mais corrupto da história;
Agora já estão do lado dele e orando por ele;
Seria cômico se não fosse trágico!!!

"Antes de tudo, recomendo que se façam súplicas, orações, intercessões e ações de graças por TODOS os homens;
pelos reis e por TODOS os que exercem autoridade, para que tenhamos uma vida tranquila e pacífica, com toda a piedade e dignidade."
1 Timóteo 2:1-2
